export default function Accordion() {
  return (
    <div className="accordion">
      <div className="accordionHeading">
        <div className="container">
          <p>Question</p>
          <span>CLICK ME</span>
        </div>
      </div>

      <div className="accordionContent">
        <div className="container"></div>
      </div>
    </div>
  );
}
